('2119','2','8287','Whg. Plangger',Null,'Gepflegte Erdgeschosswohnung in Top Wohnanlage in Santa Ponsa','30066','Diese Wohnanlage steht in Nova Santa Ponsa nur wenige Fahrminuten von 3 Golfplätzen und 2 Jachthäfen entfernt. Sie gehört zu den beliebtesten Apartmentanlagen von Santa Ponsa.\r\nDie Erdgeschosswohnung mit ca. 124 m² Wohnfläche bietet 2 Schlafzimmer, 2 Bäder, Wohn-Esszimmer, Eingangsdiele mit Garderobe Schränken, Küche und Hauswirtschaftsraum. Ausgesuchte Möbel und eine hochwertige Ausstattung zeichnet diese gepflegte Wohnung aus. Von der überdachten Terrasse und dem ca. 100 m² privaten Garten aus kann man bequem den Pool und die Gemeinschaftssauna erreichen. \r\nFür die richtige Raumtemperatur sorgt eine integrierte Klimaanlage w/k und eine elektrische Fußbodenheizung in den Bädern. Die jährlichen Gemeinschaftsumlagen liegen bei ca. 4.000 €.','30067','550000','111','2013-10-02 15:51:27','110','2013-10-02 15:52:09',Null,'2011','121','958',1,'1','0',Null,Null,Null,'30068',Null,'0','0','0',Null,'2015-06-30 13:55:23',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'30069',Null,'30070',Null,'30071',Null,'30072',Null,'30073','0',0,'0');
